    }, deleteTask)

    return (
        <div
            className={"task " + status}
            id={"task-" + index}>
            <h1 onClick={changeStatus}>{task}</h1>
            <div className="icons" onClick={deleteTask}>
                <FontAwesomeIcon icon={faTrashAlt} />
            </div>
        </div>
    );
}

export default TaskItem;
